import { useState } from 'react';

export default function CreateProduct() {
  const [name, setName] = useState(null);
  return (
    <form>
      <label htmlFor="name">
        Name
        <input
          type="text"
          id="name"
          name="name"
          placeholder="Name"
          onChange={(e) => setName(e.target.value)}
          value={name}
        />
      </label>
    </form>
  );
}
